      }
      const colors = [
        '#BDD2FD',
        '#BDEFDB',
        '#C2C8D5',
        '#FBE5A2',
        '#F6C3B7',
        '#B6E3F5',
        '#D3C6EA',
        '#FFD8B8',
        '#AAD8D8',
        '#FFD6E7'
      ]
      const strokes = [
        '#5B8FF9',
        '#5AD8A6',
        '#5D7092',
        '#F6BD16',
        '#E8684A',
        '#6DC8EC',
        '#9270CA',
        '#FF9D4D',
        '#269A99',
        '#FF99C3'
      ]

      const nodes = data.nodes
      const clusterMap = new Map()
      let clusterId = 0
      if (nodes) {
        nodes.forEach(function (node) {
          // cluster
          if (node.region && clusterMap.get(node.region) === undefined) {
            clusterMap.set(node.region, clusterId)
            clusterId++
          }
          const cid = clusterMap.get(node.region)
          if (!node.style) {
            node.style = {}
          }
          node.style.fill = colors[cid % colors.length]
          node.style.stroke = strokes[cid % strokes.length]
        })
      }
      const graph = new this.$g6.Graph({
        container: 'community_container1_2',
        width: 1000,
        height: 700,
        modes: {
          default: [
            'drag-canvas',
            'zoom-canvas',
            'drag-node',
            {
              type: 'tooltip', // 提示框
              formatText (model) {
                // 提示框文本内容
                const text =
                  'id: ' +
                  model.id +
                  '<br/>exportValue: ' +
                  model.exportValue +
                  '<br/>importValue: ' +
                  model.importValue +
                  '<br/>region: ' +
                  model.region
                return text
              }
            },
            {
              type: 'edge-tooltip', // 提示框
              formatText (model) {
                // 边提示框文本内容
                const text =
                  'source: ' +
                  model.source +
                  '<br/>target: ' +
                  model.target +
                  '<br/>value: ' +
                  model.value +
                  '<br/>time: ' +
                  model.time
                return text
              }
            }
          ]
        },
        layout: {
          type: 'force',
          // type: 'fruchterman',
          // gravity: 10,
          // speed: 5,
          // clustering: true,
        },
        animate: true,
        defaultNode: {
          size: 20,
          style: {
            lineWidth: 2
          }
        },
        defaultEdge: {
          size: 1,
          color: '#e2e2e2'
        },
        // 节点不同状态下的样式集合
        nodeStateStyles: {
          // 鼠标 hover 上节点，即 hover 状态为 true 时的样式
          hover: {
            fill: 'red'
          },
          // 鼠标点击节点，即 click 状态为 true 时的样式
          click: {
            stroke: '#000',
            lineWidth: 3
          }
        },
        // 边不同状态下的样式集合
        edgeStateStyles: {
          // 鼠标点击边，即 click 状态为 true 时的样式
          click: {
            stroke: 'red',
            lineWidth: 3
          }
        }
      })
      graph.data(data)
      graph.render()

      // 监听鼠标进入节点
      graph.on('node:mouseenter', e => {
        const nodeItem = e.item
        // 设置目标节点的 hover 状态 为 true
        graph.setItemState(nodeItem, 'hover', true)
      })
      // 监听鼠标离开节点
      graph.on('node:mouseleave', e => {
        const nodeItem = e.item
        // 设置目标节点的 hover 状态 false
        graph.setItemState(nodeItem, 'hover', false)
      })
      // 监听鼠标点击节点
      graph.on('node:click', e => {
        // 先将所有当前有 click 状态的节点的 click 状态置为 false
        const clickNodes = graph.findAllByState('node', 'click')
        clickNodes.forEach(cn => {
          graph.setItemState(cn, 'click', false)
        })
        const nodeItem = e.item
        // 设置目标节点的 click 状态 为 true
        graph.setItemState(nodeItem, 'click', true)
      })
      // 监听鼠标点击节点
      graph.on('edge:click', e => {
        // 先将所有当前有 click 状态的边的 click 状态置为 false
        const clickEdges = graph.findAllByState('edge', 'click')
        clickEdges.forEach(ce => {
          graph.setItemState(ce, 'click', false)
        })
        const edgeItem = e.item
        // 设置目标边的 click 状态 为 true
        graph.setItemState(edgeItem, 'click', true)
      })
    }
  }
}
